import React, { Component } from "react";
import Table from "./Table";

export default class DillyDally extends Component {
  constructor(props) {
    super(props);
    this.state = {
      tasks: [],
    };
  }

  componentDidMount() {
    fetch("http://localhost:8080/tasks", {
      method: "GET",
    })
      .then((response) => response.json())
      .then((data) => {
        this.setState({
          tasks: data,
        });
      })
      .catch((err) => console.log('stuff'));
  }

  render() {
    return <Table tasks={this.state.tasks} />;
  }
}
